import './SubirReto.css';


const Subirreto = () => {
  	return (
    		<div className="subirreto">
      			<div className="b16170a5347c77eee4653-welcome">
        				<div className="b16170a5347c77eee4653-welcome1" />
      			</div>
      			<div className="a1">
        				<div className="cargar-archivos">Cargar archivos</div>
      			</div>
      			<div className="sobre-nosotros">Sobre nosotros</div>
      			<div className="comentarios">Comentarios</div>
      			<div className="sube-aqui-el">Sube aqui el archivo del reto</div>
      			<div className="o-arrastra-aqui">O arrastra aqui un archivo</div>
      			<img className="subirreto-child" alt="" src="Vector 3.svg" />
      			<img className="subirreto-item" alt="" src="Vector 4.svg" />
    		</div>);
};

export default Subirreto;
